import Header from "../../components/Header";
import Canjeables from "../../components/Canjeables";
import { Axios } from "axios";
import { useState, useEffect } from "react";

const HappyStylers = () => {
  const [data, setData] = useState("");
  //3- Get data
  useEffect(() => {
    Axios({
      url: "https://krysteltest.herokuapp.com/api",
    })
      .then((response) => {
        setData(response);
        console.log(response);
      })
      .catch((error) => {
        console.error(error);
      });
  });

  return (
    <div className="background">
      <Header />
      <h1>Â¡Hola Stylers!</h1>
      <Canjeables />
    </div>
  );
};

export default HappyStylers;
